import React, { Component } from "react";

class SlideShow extends Component {
    render() {
        return (
            <div>
                <div class="slides">
		<section>Single Horizontal Slide</section>
		<section>
			<section>Vertical Slide 1</section>
			<section>Vertical Slide 2</section>
		</section>
	</div>
                             
            </div>
            
        )
    }
}

export default SlideShow;
